const ConvertDataForLineChart = (dataArray) => {
  const lineChartData = [];

  // Iterar sobre cada objeto de dados
  dataArray.forEach((data) => {
    const eventType = data.y; // Tipo de evento
    const startTime = new Date(data.start); // Início do evento
    const endTime = new Date(data.end); // Fim do evento

    // Calcular a duração do evento em milissegundos
    const duration = endTime - startTime;

    // Criar um objeto com as coordenadas x e y
    const formattedData = {
      x: duration, // Usar a duração do evento como coordenada x
      y: eventType // Usar o tipo de evento como coordenada y
    };

    // Adicionar o objeto ao conjunto de dados para o gráfico de linhas
    lineChartData.push(formattedData);
  });

  return lineChartData;
};

export default ConvertDataForLineChart;
